import React, { Component } from 'react';
import logo from './static/logo.svg';
//import './App.css';

const styles = theme => ({
    root: {
        fontFamily: theme.typography.fontFamily
    },
    content: {
        maxWidth: 960,
        margin: "0 auto",
        fontFamily: theme.typography.fontFamily
    },
    stepTitleField: {
        width: "100%",
        marginTop: "15px",
        marginBottom: "35px"
    },
    navButtons: {
        marginTop: "5px",
        marginBottom: "10px",
        position: "absolute",
        marginLeft: "73.5%"
    },
    continueButton: {
        marginTop: "5px",
        marginBottom: "10px",
        position: "absolute",
        marginLeft: "76%"
    }
});

class App extends Component {
    render() {
        return (
        <div className="App">
            <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <p>
                Edit <code>src/App.js</code> and save to reload.
            </p>
            <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
            >
                Learn React
            </a>
            </header>
        </div>
        );
    }
}

export default App;
